instructions[vm.NOP] = function() { }
instructions[vm.LIT] = function()
{
  ip++;
  data.push(image[ip]);
}
instructions[vm.DUP] = function()
{
  data.dup();
}
instructions[vm.DROP] = function()
{
  data.drop();
}
instructions[vm.SWAP] = function()
{
  data.swap();
}
instructions[vm.PUSH] = function()
{
  address.push(data.pop());
}
instructions[vm.POP] = function()
{
  data.push(address.pop())
}
instructions[vm.JUMP] = function()
{
  ip = data.pop() - 1;
}
instructions[vm.CALL] = function()
{
  address.push(ip);
  ip = data.pop() - 1;
}
instructions[vm.CCALL] = function()
{
  var a, b;
  a = data.pop();
  b = data.pop();
  if (b != 0) {
    address.push(ip);
    ip = a - 1;
  }
}
instructions[vm.RETURN] = function()
{
  ip = address.pop();
}
instructions[vm.EQ] = function()
{
  var a, b;
  a = data.pop();
  b = data.pop();
  if (b == a)
    data.push(-1);
  else
    data.push(0);
}
instructions[vm.NEQ] = function()
{
  var a, b;
  a = data.pop();
  b = data.pop();
  if (b != a)
    data.push(-1);
  else
    data.push(0);
}
instructions[vm.LT] = function()
{
  var a, b;
  a = data.pop();
  b = data.pop();
  if (b < a)
    data.push(-1);
  else
    data.push(0);
}
instructions[vm.GT] = function()
{
  var a, b;
  a = data.pop();
  b = data.pop();
  if (b > a)
    data.push(-1);
  else
    data.push(0);
}
instructions[vm.FETCH] = function()
{
  x = data.pop();
  data.push(image[x]);
}
instructions[vm.STORE] = function()
{
  image[data.tos()] = data.nos();
  data.drop();
  data.drop();
}
instructions[vm.ADD] = function()
{
  var x = data.pop();
  var y = data.pop();
  data.push(x + y);
}
instructions[vm.SUB] = function()
{
  var x = data.pop();
  var y = data.pop();
  data.push(y - x);
}
instructions[vm.MUL] = function()
{
  var x = data.pop();
  var y = data.pop();
  data.push(y * x);
}
instructions[vm.DIVMOD] = function()
{
  var b = data.pop();
  var a = data.pop();
  if (b == 0)
  {
    ip = 0;
    data.sp = 0;
    address.sp = 0;
  }
  else
  {
    var x = Math.abs(b);
    var y = Math.abs(a);
    var q = Math.floor(y / x);
    var r = y % x;
    if (a < 0 && b < 0)
      r = r * -1;
    if (a > 0 && b < 0)
      q = q * -1;
    if (a < 0 && b > 0)
    {
      r = r * -1;
      q = q * -1;
    }
    data.push(r);
    data.push(q);
  }
}
instructions[vm.AND] = function()
{
  var x = data.pop();
  var y = data.pop();
  data.push(x & y);
}
instructions[vm.OR] = function()
{
  var x = data.pop();
  var y = data.pop();
  data.push(x | y);
}
instructions[vm.XOR] = function()
{
  var x = data.pop();
  var y = data.pop();
  data.push(x ^ y);
}
instructions[vm.SHIFT] = function()
{
  var x = data.pop();
  var y = data.pop();
  if (x < 0)
    data.push(y << (x * -1));
  else
    data.push(y >>= x);
}
instructions[vm.ZERO_EXIT] = function()
{
  if (data.tos() == 0)
  {
    data.drop();
    ip = address.pop();
  }
}
instructions[vm.END] = function()
{
  ip = IMAGE_SIZE;
}
